import React, { useState } from 'react';
import './prev.css';
import {Button} from '@mui/material';
import Snackbar, { SnackbarOrigin } from '@mui/material/Snackbar';
import { TableBody, TableCell, TableRow, TableHead, TableContainer, Table } from '@mui/material';
export default function Preview() {
  



  return (
    <>
    <div className='preview'>
        <div className='workoutdata'>
        
        <Snackbar
                    open={true}
                    autoHideDuration={60}
                    sx={{ height: "10%" }}
                        anchorOrigin={{
                            vertical: "top",
                            horizontal: "center"
                            
                        }}
                    
                    // onClose={handleClose}
                    // anchorOrigin={{ vertical, horizontal }}
                    // key = {vertical + horizontal}
                    position ="top"
                    message="Workout is added successfully"/>
                    <i class="fa-solid fa-xmark-large"></i>
                    <h1>Workout Preview</h1>
        

        </div>
        
      
    </div>
    <div>
      <TableContainer>
        <Table border='1' style={{display:'flex', justifyContent:'center'}}>
            <TableHead>
                <TableRow style={{backgroundColor:'burlywood', color:'aliceblue'}}>
                    <TableCell>Exercise Name</TableCell>
                    <TableCell>Sets</TableCell>
                    <TableCell>Reps</TableCell>
                    <TableCell>Unit</TableCell>
                    <TableCell>Date</TableCell>
                    
                    
                </TableRow>
            </TableHead>
            {/* <TableBody>
                {finalData.map((data) =>(
                    <TableRow key = {data.email}>
                        <TableCell>{data.firstname}</TableCell>
                        <TableCell>{data.lastname}</TableCell>
                        <TableCell>{data.contact}</TableCell>
                        <TableCell>{data.email}</TableCell>
                        <TableCell>{data.country}</TableCell>
                       
                        
                    </TableRow>
                ))}
            </TableBody> */}
        </Table>
      </TableContainer>
    </div>
    </>
  )
}
